import isString from 'lodash/isString'

/**
 * 此应用依赖外部容器环境提供的存储
 */
const isDev = process.env.NODE_ENV === 'development'

// const isDev = true

/**
 * 保存缓存数据
 * @param cover
 * @param config
 * @returns {Promise<void>}
 */
export async function save(cover, config) {
  if (isDev) {
    localStorage.setItem('game-balloon-data', JSON.stringify(config))
    return
  }
  if (!parent.window.smartclasssave) {
    return Promise.reject(new Error('保存设置失败'))
  }
  cover = cover || 'data:image/jpeg;base64,'
  await parent.window.smartclasssave(cover, JSON.stringify({
    groupCompetition: config,
  }))
}

/**
 * 读取缓存数据
 * @returns {Promise<*>}
 */
export async function load() {
  if (isDev) {
    const data = localStorage.getItem('game-balloon-data')
    return JSON.parse(data)
  }
  if (!parent.window.smartclassload) {
    return Promise.reject(new Error('读取设置失败'))
  }
  const data = await parent.window.smartclassload()
  console.log('读取缓存数据', data)
  return isString(data) ? JSON.parse(data).groupCompetition : data.groupCompetition
}
